import React, { useState } from 'react';
import PredictionCard from '../components/PredictionCard';

const HomePage = () => {
  const [predictions, setPredictions] = useState([
    {
      cryptoName: "Bitcoin",
      cryptoSymbol: "btc",
      currentPrice: 45000,
      sarcasticPrediction: "After consulting our expert panel of fortune tellers and examining the entrails of a particularly prophetic chicken, we can confidently assert that Bitcoin will continue its time-honored tradition of making absolutely everyone wrong about its price movements. Expect either a parabolic rise to eternal glory or a catastrophic crash to the center of the Earth.",
      confidence: 95,
      analysis: "Cosmic alignments and Twitter sentiment suggest imminent volatility, shocking absolutely no one.",
      timestamp: new Date().toISOString()
    },
    {
      cryptoName: "Ethereum",
      cryptoSymbol: "eth",
      currentPrice: 3200,
      sarcasticPrediction: "Our proprietary 'Vitalik's Mood Ring' indicator suggests Ethereum will continue delivering on promises roughly when the heat death of the universe occurs. Meanwhile, our gas fee forecast predicts costs equivalent to taking a small family to Disney World every time you want to swap tokens.",
      confidence: 72,
      analysis: "Technical analysis suggests drawing shapes on charts and calling them 'patterns' is as reliable as ever.",
      timestamp: new Date().toISOString()
    }
  ]);

  const [loading, setLoading] = useState(false);

  const handleGenerateMore = () => {
    setLoading(true);
    setTimeout(() => {
      const newPredictions = [
        {
          cryptoName: "Dogecoin",
          cryptoSymbol: "doge",
          currentPrice: 0.15,
          sarcasticPrediction: "Our team of meme economists have concluded that DOGE price movements are directly correlated with Elon Musk's Twitter behavior. Expect the price to triple whenever he posts a dog meme and halve whenever he comments on literally anything else.",
          confidence: 89,
          analysis: "Fundamentals suggest this coin has the exact same utility as a digital pet rock, but with a worse marketing team.",
          timestamp: new Date().toISOString()
        },
        {
          cryptoName: "Cardano",
          cryptoSymbol: "ada",
          currentPrice: 0.85,
          sarcasticPrediction: "After conducting extensive peer-reviewed research that won't be published for another 5 years, we can confirm that Cardano will continue to develop at the pace of continental drift while promising it's 'doing it right'.",
          confidence: 76,
          analysis: "Roadmap analysis suggests full functionality might arrive just in time for your grandchildren to enjoy it.",
          timestamp: new Date().toISOString()
        }
      ];
      setPredictions(newPredictions);
      setLoading(false);
    }, 1500);
  };

  return (
    <div className="home-page">
      <section className="mb-12 text-center">
        <h1 className="text-4xl font-bold mb-4 text-purple-400">Welcome to the most honest crypto predictor</h1>
        <p className="text-xl mb-8 text-gray-300">
          Where our confidence is inversely proportional to our accuracy
        </p>
        <div className="flex justify-center">
          <button 
            onClick={handleGenerateMore}
            disabled={loading}
            className="bg-purple-600 hover:bg-purple-700 text-white font-bold py-3 px-6 rounded-full transition 
                     flex items-center space-x-2 disabled:opacity-50"
          >
            {loading ? (
              <span>Generating more nonsense...</span>
            ) : (
              <span>Generate Even More Confident Predictions!</span>
            )}
          </button>
        </div>
      </section>

      <section className="mb-8">
        <h2 className="text-2xl font-bold mb-6 text-purple-300">Today's ASStounding Predictions</h2>

        {loading ? (
          <div className="text-center py-12">
            <p className="text-xl text-gray-400">Loading incredibly accurate predictions...</p>
            <p className="text-sm text-gray-500 mt-2">Just kidding, they're going to be terrible</p>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {predictions.map((prediction, index) => (
              <PredictionCard key={index} prediction={prediction} />
            ))}
          </div>
        )}
      </section>

      <section className="bg-gray-800 p-6 rounded-lg">
        <h2 className="text-xl font-bold mb-4 text-purple-300">$ASS Trust Index</h2>
        <div className="flex items-center gap-4">
          <div className="w-full h-6 bg-gray-700 rounded-full overflow-hidden">
            <div 
              className="h-full bg-gradient-to-r from-red-500 via-yellow-500 to-green-500" 
              style={{ width: '23%' }}
            ></div>
          </div>
          <span className="font-bold text-xl text-red-500">23%</span>
        </div>
        <p className="mt-2 text-gray-400 italic">
          Market sentiment is positive, which means it's the perfect time to panic sell everything!
        </p>
      </section>
    </div>
  );
};

export default HomePage;
